Let's design a computational model to predict responder acceptance behavior in this economic game.  The key psychological mechanisms at play likely involve:

1. **Fairness:** Responders may be sensitive to whether the proposed split is perceived as fair relative to the contributions of each player (token_self and token_opp).  A simple difference might not suffice because fairness perception is likely relative to the combined earnings.

2. **Self-interest:** Responders will naturally prefer larger payouts (split_self).  The relative gain, compared to a 50/50 split or other benchmark, might matter more than the absolute gain.

3. **Risk aversion/seeking:** Responders might be averse to accepting a small amount of money or prefer a sure thing to a gamble. The level of risk aversion could vary across participants.

4. **Trial type effect:** The trial type (equal, opponent more, participant more) may influence the perception of fairness and acceptance thresholds.

Considering these mechanisms, a model with a few learnable parameters is desirable to avoid overfitting and ensure parameter recovery.  A weighted linear combination of these factors, passed through a logistic function to predict a probability of acceptance, seems appropriate.

<MODEL>
U = w1 * (split_self / combined_earning - 0.5) + w2 * (token_self / (token_self + token_opp)) + w3 * (trial_type == 1) + w4 * (trial_type == 2) + w5 * (trial_type == 3) + w6 * (split_self)

P(accept) = 1 / (1 + exp(-U))
</MODEL>


